import React from "react";
import NavBar from "./NavBar";

function Chat() {
  return (
    <div>
      <NavBar />
      <div id="ChatDiv">
        <div id="DmName"></div>
        <div id="messageContainer"></div>
        <div id="WriteCommentContainer"></div>
      </div>
    </div>
  );
}

export default Chat;
